import React from 'react'
import { Col } from 'react-bootstrap/Col'
import EditorField from './Fields/EditorField'
import { Field } from 'formik'

function RenderEditorTab({ xs, md, name }) {
    return (
        <Col xs={xs} md={md}>
            <Field name={`${name}`} component={EditorField} />
        </Col>
    )
}

export default RenderEditorTab
